エルフがレーシングフィールドで40年以上にわたって培ってきた合成潤滑油技術を結集したプレミアムエンジンオイルです。<br>
ヨーロッパ自動車メーカー各社の認証規格を取得、輸入車から国産車の過給機付（ターボやスーパーチャージャー）エンジン、自然吸気（NA）エンジン、直噴（ダイレクトインジェクション）エンジンなど幅広く対応します。  <br>
<br>
ACEA: A3/B4<br>
API: SN/CF<br>
Mercedes-Benz: MB 229.5 / 229.3<br>
BMW: Longlife-01<br>
Volkswagen: VW 502.00 / 505.00<br>
